import React, { useState } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';
import '../main/register.css';
import config from '../config';

export default function PatientRegister() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    age: '',
    gender: '',
    past_problems: '',
    current_medications: '',
    password: ''
  });
  const [message, setMessage] = useState("");
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData({ ...formData, [id]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(`${config.url}/patient/register`, formData);
      setMessage(response.data.message);
      setError("");
      navigate("/patientlogin");
    } catch (error) {
      setMessage("");
      setError(error.response?.data?.error || "Registration failed.");
    }
  };

  return (
    <div className="container">
      <h3 className="heading"><u>Patient Registration</u></h3>
      {message && <h4 className="message">{message}</h4>}
      {error && <h4 className="error">{error}</h4>}
      <form onSubmit={handleSubmit}>
        <div className="inputContainer">
          <label className="label">Name</label>
          <input className="input" type="text" id="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div className="inputContainer">
          <label className="label">Email</label>
          <input className="input" type="email" id="email" value={formData.email} onChange={handleChange} required />
        </div>
        <div className="inputContainer">
          <label className="label">Age</label>
          <input className="input" type="number" id="age" value={formData.age} onChange={handleChange} required />
        </div>
        <div className="inputContainer">
          <label className="label">Gender</label>
          <select className="input" id="gender" value={formData.gender} onChange={handleChange} required>
            <option value="">Select</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
            <option value="Other">Other</option>
          </select>
        </div>
        <div className="inputContainer">
          <label className="label">Past Medical Problems</label>
          <input className="input" type="text" id="past_problems" value={formData.past_problems} onChange={handleChange} />
        </div>
        <div className="inputContainer">
          <label className="label">Current Medications</label>
          <input className="input" type="text" id="current_medications" value={formData.current_medications} onChange={handleChange} />
        </div>
        <div className="inputContainer">
          <label className="label">Password</label>
          <input className="input" type="password" id="password" value={formData.password} onChange={handleChange} required />
        </div>
        <button type="submit" className="button">Register</button>
      </form>
      <p className="registerMessage">Already have an account? <Link to="/patientlogin">Login here</Link></p>
    </div>
  );
}
